import React from 'react';
import logo from '../car-svgrepo-com.svg';
import '../App.css';

function HomePage() {
    return (
        <>
            <h2>Technologies used for development of this website.</h2>

            <article>



                <p>EV-Assist</p>

                <p>A tool for determining the closest electrical vehicle charging station to a given address
                within the United States.</p>

                <a
                    className="App-link"
                    href="https://afdc.energy.gov/stations/#/find/nearest"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Data Source
                </a>

            </article>
         </>
    );
}

export default HomePage;
